import React from 'react';

export default () => {

    onClick = (e) => {
        let num = Math.floor(Math.random() * Math.floor(10));
        console.log(num);
    };
    

    return(
        <div className='container mt-3'>
            <button className='col-sm-6 offset-3 btn btn-primary btn-lg' onClick={onClick}> Randomize </button>
        </div>
    )

}
